in_source: |-
  section .data
      res: 0x0
      current_i: 0x0

  section .code
      cls

  loop_3: load current_i
      add 0x3
      store current_i

      add res
      store res

      load current_i
      sub 0x999
      jmpz end_3
      jmp loop_3

  end_3: cls
      store current_i

  loop_5: load current_i
      add 0x5
      store current_i
      add res
      store res

      load current_i
      sub 0x995
      jmpz end_5
      jmp loop_5

  end_5: cls
      store current_i

  loop_15: load current_i
      add 0x15
      store current_i
      sub res
      neg
      store res

      load current_i
      sub 0x990
      jmpz end_15
      jmp loop_15

  end_15: load res
      output
  	hlt
